                "text": "Волжская ГЭС (ранее Сталинградская ГЭС, Волжская ГЭС имени XXII съезда КПСС) — гидроэлектростанция на реке Волга в Волгоградской области, между городами Волгоград и Волжский. Крупнейшая гидроэлектростанция в Европе, в 1960—1963 годах была крупнейшей ГЭС в мире. Входит в Волжско-Камский каскад ГЭС, являясь его нижней ступенью. Волжская ГЭС играет важную роль в обеспечении надёжности работы Единой энергосистемы России, а также обеспечивает крупнотоннажное судоходство, водоснабжение, орошение засушливых земель. Собственником Волжской ГЭС (за исключением судоходного шлюза, а также автодорожного и железнодорожного переходов) является ПАО «РусГидро»."
